const solve = (input) => {
    var min = 50000;
    var array = new Array(...input);
    for(let i='A'.charCodeAt(0);i<'Z'.charCodeAt(0);i++){
        let filtered = array.filter((value, index, self) => {
            return (value != String.fromCharCode(i) && value != String.fromCharCode(i+32) )
         })
        for(let index =0; index<filtered.length; index++){
            if(index != 0){
                if(filtered[index].charCodeAt(0) == filtered[index-1].charCodeAt(0) - 32 ||
                filtered[index].charCodeAt(0) == filtered[index-1].charCodeAt(0) + 32){
                    filtered.splice(index-1,2);
                    index=-1;
                }
            }
        }

        if(filtered.length < min){
            min = filtered.length
        }
    }

    return min;
}


var input=``
solve(input);